  return (
    <PageContent title="Welcome page !">
      <button><Link to="/auth">let's start</Link></button>
      {token.role ==='admin' && (<Card Title='admin view' /> )  }

      <Card Title='user view' />
    </PageContent>
  );
}

export default HomePage;
